import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'
//三级联动组件--全局组件
import TypeNav from "./components/TypeNav";
import "./mock/mockServe";
import 'swiper/css'

Vue.component(TypeNav.name, TypeNav)

Vue.config.productionTip = false


new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app')
